import React from 'react'
import './style/watch.css'



class Movielist extends React.Component {

    componentDidMount() {
        //Fetch Movie list
        fetch("http://localhost:9000/watch", {
            method: "post",
            headers: {'Content-Type': 'application/json'},
            result: JSON.stringify({"tetst": "a"})
        })
        .then(res => res.json())
        .then((data) => {
            console.log(data)
        })

    }


    render() {
        return(
            <div id="watch">
            </div>
        )
    }
}

export default Movielist;
